import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import { Route, Routes } from "react-router-dom";
import About from "./About";
import Contact from "./Contact";
import Service from "./Service";
import Menu from "./Menu";
import User from "./User";
import Search from "./Search";
import Error from "./Error";

const App = () => {
  // const Name = () => {
  //   return <h1>Hello, This is name page</h1>;
  // };
  return (
    <>
      {/* <Menu />
      <Routes>
        <Route path="/" Component={() => <About name="About" />} />
        <Route path="/service" Component={() => <Service name="Service" />} />
        <Route path="/search" Component={() => <Search name="Search" />} />
        <Route path="/contact" Component={() => <Contact name="Contact" />} />
        <Route
          path="/user/:fname/:lname"
          Component={() => <User name="user" />}
        />
        <Route Component={Error} />
      </Routes> */}
      {/* <About />
        <Contact /> */}
      <div className="container mx-auto">
        <h1 className="text-center ">Welcome</h1>
        <br />
        <div className="text-center">
          <div class="card" style={ {"width": "18rem"}}>

            <img src="..." class="card-img-top" alt="..." />
            <div class="card-body">
              <h5 class="card-title">Card title</h5>
              <p class="card-text">
                Some quick example text to build on the card title and make up
                the bulk of the card's content.
              </p>
              <a href="#" class="btn btn-primary">
                Go somewhere
              </a>
            </div>
          </div>
          <button className="btn btn-outline-success">Welcome to future</button>
        </div>
      </div>
    </>
  );
};

export default App;
